export const rudderKey = "1TuzGaFJUo36sMVMJYnbwBV0DJd";
console.log("rudder sdk loaded");
console.log("rudder sdk key" + rudderKey);

export function eventIdentify() {

    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.identify("Identify Call", {
        name: "Sajal Mohanta",
        category: "SampleIdentify",
        email: "sajal@abc.com",
        plan: "Open source",
        logins: 5
    },
        {
            context: {
                ip: '0.0.0.0',
            },
            page: {
                path: 'sdsd',
                referrer: 'dsds',
                search: 'ssss',
                title: 'dddsdsd',
                url: 'sdsdsadd'
            },
             anonymousId: "dsknkcnd",
        });
        analytics.identify("Identify Call", {
            name: "Sajal Mohanta",
            category: "SampleIdentify",
            email: "sajal@abc.com",
            plan: "Open source",
            logins: 5
        },
            {
                context: {
                    ip: '0.0.0.0',
                },
                page: {
                    path: 'sdsd',
                    referrer: 'dsds',
                    search: 'ssss',
                    title: 'dddsdsd',
                    url: 'sdsdsadd'
                },
                 anonymousId: "dsknkcnd",
            });
    console.log("rudder identify call");
}

export function eventPage() {
    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.page('Application Loaded',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });

        analytics.page('Application Loaded',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });
    console.log("rudder page call");
}

export function eventTrack() {
    var rudderanalytics = global.window.rudderanalytics = global.window.rudderanalytics || [];
    var analytics = global.window.analytics = global.window.analytics || [];
    rudderanalytics.track('Track Call',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });
        rudderanalytics.track('Experiment Viewed', {
            experiment_id: 'home-page-title-2819',
            variation_name: 'Variation 1'
          });

        analytics.track('Track Call',
        {
            path: 'path',
            referrer: 'referrer',
            search: 'search',
            title: 'title',
            url: 'url',
        },
        {
            context: {
                ip: '0.0.0.0'
            },
             anonymousId: '00000000000000000000000000'
        });


        analytics.alias("507f191e81");


        // analytics.track('Track Call2',
        // {
        //     path: '',
        //     referrer: '',
        //     search: '',
        //     title: '',
        //     url: '',
        // },
        // {
        //     context: {
        //         ip: '0.0.0.0'
        //     },
        // });
    console.log("rudder track call");
}
